import axios from 'axios';
import React, { useEffect, useState } from "react";
import Table from 'react-bootstrap/Table';


function Sheep_info() {

    const [reviewCow, setReviewCow] = useState([]);

    useEffect(() =>{
        axios.get('http://localhost:3001/api/sheepI').then((response) =>{
            setReviewCow(response.data)
        })
    }, [])


  return (
    <div>
        <h1>Brown SWiss</h1>
        <Table striped bordered hover variant="dark">

        </Table>
        {reviewCow.map((val)=>{
            return (
                <div>

                <Table striped bordered hover variant="dark">
                    <thead>
                        <tr>
                         <th>#</th>
                         <th>Breed</th>
                         <th>Sex</th>
                         <th>Age</th>
                         <th>Color</th>
                         <th>height</th>
                         <th>Weight</th>
                         <th>Income</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                          <td>{val.animalID}</td>
                          <td>{val.breed}</td>
                          <td>{val.sex}</td>
                          <td>{val.age}</td>
                          <td>{val.color}</td>
                          <td>{val.height}</td>
                          <td>{val.weight}</td>
                          <td>{val.income }</td>
                        </tr>
                    </tbody>
                </Table>

                </div>

                )
            })}
    </div>
  )
}

export default Sheep_info
